import { ActionType } from "../contanst/action-type";

const initialState = {
  datas: [],
};

export const dataReducer = (
  state = initialState,
  action,
  { type, payload }
) => {
  switch (type) {
    case ActionType.GET_DATA:
      return {...state , };
    default:
      return state;
  }
};
